import React from "react";

const RootLayout = () => {
    return (
        <div class="root-layout">
            <header>
                <nav>
                    <h1 class="logo">lowacase</h1>
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/about">About</NavLink>
                    <NavLink to="/blog">Blog</NavLink>
                </nav>
            </header>
        </div>
    );
}

export default RootLayout;
